import './App.css';
import Image from './Image';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Image src={'https://cdn.pixabay.com/photo/2017/02/20/18/03/cat-2083492_1280.jpg'} alt={'Cute cat staring'}/>
      </header>
    </div>
  );
}

export default App;
